# ===== MODULE FUNCTIONS ========

# Map Minimum and Maximum Input Processing Function
def mapminmax_apply(x,settings):
  y = x - settings.xoffset
  y = np.multiply(y,settings.gain)
  y = y + settings.ymin
  return y

# Competitive Transfer Function
def compet_apply(n):
  if len(n)==0:
    a = n
  else:
    [S,Q] = np.shape(n)
    nanInd = any(np.isnan(n))
    a = np.zeros([S,Q],like=n)
    maxRows = np.argmax(n,axis=0)
    onesInd = maxRows + np.dot(S,range(0,(Q-1)))
    if len(onesInd)==0:
      onesInd=0
    a[onesInd] = 1
    a[:,nanInd] = np.NaN
  
  return a

# Sigmoid Positive Transfer Function
def logsig_apply(n):
  a = np.divide(1,1 + np.exp(-n))
  return a

# Radial Basis Transfer Function
def radbas_apply(n):
  a = np.exp(-(np.multiply(n,n)))
  return a

# Map Minimum and Maximum Output Reverse-Processing Function
def mapminmax_reverse(y,settings):
  x = y - settings.ymin
  x = np.divide(x,settings.gain)
  x = x + settings.xoffset
  return x
